const float lobatto_pts[4] = float[](0, 0.276393202, 0.723606798, 1);
const float w[4] = float[](-5, 11.1803398, -11.1803398, 5);
const int dof_map[64] = int[](
    0, 8, 9, 1, 14, 34, 35, 10, 15, 32, 33, 11, 3, 
    12, 13, 2, 24, 36, 37, 26, 49, 56, 57, 40, 48, 
    58, 59, 41, 30, 45, 44, 28, 25, 38, 39, 27, 51, 
    60, 61, 42, 50, 62, 63, 43, 31, 47, 46, 29, 4, 
    16, 17, 5, 22, 52, 53, 18, 23, 54, 55, 19, 7, 
    20, 21, 6);
 void poly1d(in float y, out float u[4]){            
     int i = 3;                                       
     int k = 3;                                       
     float lk = 1.;                                        
     for (k = 0; k < 3; k++){                         
         if (y >= (lobatto_pts[k] + lobatto_pts[k+1])/2){  
             lk *= y - lobatto_pts[k];                     
         } else {                                          
             for (i = k+1; i <= 3; i++) {             
                 lk *= y - lobatto_pts[i];                 
             }                                             
             break;                                        
         }                                                 
     }                                                     
     float l = lk * (y - lobatto_pts[k]);                  
     for (i = 0; i < k; i++) {                             
         u[i] = l * w[i] / (y - lobatto_pts[i]);           
     }                                                     
     u[k] = lk * w[k];                                     
     for (i++; i <= 3; i++) {                         
         u[i] = l * w[i] / (y - lobatto_pts[i]);           
     }                                                     
 };                                                        

float element_interpolation(in vec3 ref_pos, in float values[64]){ 
 float shape_x[3+1];                                                      
 float shape_y[3+1];                                                      
 float shape_z[3+1];                                                      
 poly1d(ref_pos.x, shape_x);                                                   
 poly1d(ref_pos.y, shape_y);                                                   
 poly1d(ref_pos.z, shape_z);                                                   
 float result = 0.;                                           
 int n = 0;                                                                    
 for (int k = 0; k <= 3; k++){                                            
     for (int j = 0; j <= 3; j++){                                        
         for (int i = 0; i <= 3; i++){                                    
             result += shape_x[i]*shape_y[j]*shape_z[k]*values[dof_map[n]];    
             n += 1;                                                           
         }                                                                     
     }                                                                         
 }                                                                             
    return result;
}

